import React from "react";
import './App.css';
import Banner from './Banner.js';

document.body.style = 'background: #918866;';

class Header extends React.Component {
    render() {
        return (
            <div class="header">
                <h1>Social Media 2.0</h1>
            </div>
        );
    }
}

class Body extends React.Component {
    render() {
        return (
            <div class="body">

            </div>
        );
    }
}

export default function App() {
    return (
        <div>
            <div>
                <Banner/>
            </div>
            <div>
                <Body/>
            </div>
        </div>

    );
}
